INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, "2015/12/17 15:00:00", -363.0, 1, "キャル", 106001, "2030/12/17 14:59:59", 0.0, 1, 7001, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, "2015/12/17 15:00:00", -363.0, 1, "コッコロ", 105901, "2030/12/17 14:59:59", 0.0, 1, 7002, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, "2015/12/17 15:00:00", -363.0, 1, "ペコリーヌ", 105801, "2030/12/17 14:59:59", 0.0, 1, 7003, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, "2015/12/17 15:00:00", -363.0, 1, "ペコリーヌ", 105801, "2030/12/17 14:59:59", 0.0, 1, 10001, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, "2015/12/17 15:00:00", -363.0, 1, "キャル", 106001, "2030/12/17 14:59:59", 0.0, 1, 10002, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, "2015/12/17 15:00:00", -363.0, 1, "コッコロ", 105901, "2030/12/17 14:59:59", 0.0, 1, 10003, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, "2015/12/17 15:00:00", -363.0, 2, "シェフィ", 106401, "2030/12/17 14:59:59", 0.0, 1, 10004, 1, 0, 2104010);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, "2015/12/17 15:00:00", -416.5, 1, "ペコリーヌ", 105801, "2030/12/17 14:59:59", 0.0, 1, 12001, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, "2015/12/17 15:00:00", -363.0, 1, "キャル", 106001, "2030/12/17 14:59:59", 0.0, 1, 13001, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, "2015/12/17 15:00:00", -363.0, 1, "コッコロ", 105901, "2030/12/17 14:59:59", 0.0, 1, 13002, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, "2015/12/17 15:00:00", -363.0, 2, "シェフィ", 106401, "2030/12/17 14:59:59", 0.0, 1, 13003, 1, 0, 2104010);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, "2015/12/17 15:00:00", -363.0, 1, "ペコリーヌ", 105801, "2030/12/17 14:59:59", 0.0, 1, 13004, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, "2015/12/17 15:00:00", -363.0, 1, "コッコロ", 105901, "2030/12/17 14:59:59", 0.0, 1, 14001, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, "2015/12/17 15:00:00", -363.0, 2, "シェフィ", 106401, "2030/12/17 14:59:59", 0.0, 1, 14002, 1, 0, 2104010);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, "2015/12/17 15:00:00", -363.0, 1, "ペコリーヌ", 105801, "2030/12/17 14:59:59", 0.0, 1, 14003, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, "2015/12/17 15:00:00", -363.0, 1, "キャル", 106001, "2030/12/17 14:59:59", 0.0, 1, 14004, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, "2015/12/17 15:00:00", -470.0, 1, "コッコロ", 105901, "2030/12/17 14:59:59", 0.0, 1, 15001, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, "2015/12/17 15:00:00", -363.0, 2, "シェフィ", 106401, "2030/12/17 14:59:59", 0.0, 1, 16001, 1, 0, 2104010);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, "2015/12/17 15:00:00", -363.0, 1, "ペコリーヌ", 105801, "2030/12/17 14:59:59", 0.0, 1, 16002, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, "2015/12/17 15:00:00", -363.0, 1, "キャル", 106001, "2030/12/17 14:59:59", 0.0, 1, 16003, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, "2015/12/17 15:00:00", -363.0, 1, "コッコロ", 105901, "2030/12/17 14:59:59", 0.0, 1, 16004, 1, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, "2015/12/17 15:00:00", -363.0, 1, "コッコロ", 105901, "2030/12/17 14:59:59", 0.0, 1, 17002, 1, 0, 0);
