INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, "2015/12/17 15:00:00", -363.0, 2, "シェフィ", 106401, "2030/12/17 14:59:59", 0.0, 1, 17006, 1, 0, 2104010);
