INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, "2015/12/17 15:00:00", -363.0, 1, "キャル", 106001, "2030/12/17 14:59:59", 0.0, 1, 21001, 1, 0, 0);
