INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, "2015/12/17 15:00:00", -430.0, 1, "カリン", 190801, "2030/12/17 14:59:59", 0.0, 1, 23002, 4, 0, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 4.08, "2019/01/31 12:00:00", -385.0, 1, "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59", 8.0, 2, 24001, 1, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 5.0, "2019/01/31 12:00:00", -385.0, 1, "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59", 8.0, 2, 24002, 2, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10.11, "2019/01/31 12:00:00", -385.0, 1, "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59", 8.0, 2, 24003, 3, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4.0, "2019/01/31 12:00:00", -385.0, 1, "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59", 8.0, 2, 24004, 4, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 6.0, "2019/01/31 12:00:00", -385.0, 1, "エリコ（バレンタイン）", 109001, "2030/12/17 14:59:59", 8.0, 2, 24005, 5, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59", 0.0, 1, 24006, 6, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59", 0.0, 1, 24007, 7, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59", 0.0, 1, 24008, 8, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59", 0.0, 1, 24009, 9, 10011, 0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 109002, "2030/12/17 14:59:59", 0.0, 1, 24010, 10, 10011, 0);
